  container: {
    backgroundColor: "white",
    height: '100%',
    width: '100%',
    position: 'fixed',
    zIndex: 49,
    padding: 15
  }
});


const Userpage = () => {


  return (
    <>
       <View style={styles.container}>
           <Text>Profile picture</Text>
           <Text>Bio</Text>
           <Text>Pictures & videos</Text>
           <Text>Interests</Text>
       </View>
    </>

  );
};

export default Userpage;
